import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{

  constructor(){
    super();

    this.state = {veggies: [{
                    name: 'Carrot'
                  },
                  {
                    name: 'Squash'
                  },
                  {
                    name: 'Zucchini'
                  }],
                  nums: [2, 3, 4]
                }
  }

  render(){
    return (
      <div className="App">
        <p>Sum with accumlator starting of 5 is {this.state.nums.map((sum, num) => sum + num, 5)}</p>
      </div>
    );
  }
}

export default App;
